import styled from 'styled-components';

export const BodyHomeBody = styled.div`
    width:1280px;
    height:auto;
    margin:auto;
    z-index : 1;
`;

export const PageBody = styled.div`
    background-color: rgb(255,255,255);
`;

export const Titre2 = styled.div`
    color: rgb(0, 0, 0);
    z-index : 1;
    text-align: center;
    font-weight: bold;
    font-size: 0.75cm;
    padding: 1cm;
`;
export const SousTitre = styled.div`
    color: rgb(0, 0, 0);
    z-index : 1;
    text-align: center;
    font-weight: bold;
    font-size: 32;
    padding: 0.5cm;
`;
export const Carte = styled.div`
    margin : auto;
    width: 50%; 
    height: 530px;
`;
export const ImageLogo = styled.div`
    display: flex;
    margin : auto;
    width: auto; 
    height: auto;
    align-items:center;
    justify-content:center;
`;
